import React from 'react';
import styled from 'styled-components';
import FormContainer from './login/FormContainer';

const Home = () => {
	return (
		<Main>
			<FormContainer />
		</Main>
	);
};

const Main = styled.main`
	width: 100vw;
	min-height: 100vh;
	background-color: green;
	display: flex;
	justify-content: center;
	align-items: center;
`;

export default Home;
